import React from "react";
import Navbar from "../components/header/Navbar";
import { useSelector, useDispatch } from "react-redux";
import { removeWishlist } from "../components/redux/ShoppingCart";
import { toast } from "react-hot-toast";
import { Link } from "react-router-dom";

const Account = () => {
  const { wish } = useSelector((state) => state.user);
  const { quantity, amount } = useSelector((state) => state.user);

  const dispatch = useDispatch();

  const handleRemoveWish = (cartItem) => {
    dispatch(removeWishlist(cartItem));
    toast.success("Item Removed!");
  };

  return (
    <>
      <Navbar />
      <div className="profile-container">
        <div className="profile-info">
          <div>
            <h1 className="user">Unknown User</h1>
            <div className="order-info">
              <div>
                <h1>{quantity}</h1>
                <h1>Order</h1>
              </div>
              <div>
                <h1>{amount}</h1>
                <h1>Price</h1>
              </div>
            </div>
          </div>
          <img
            src="https://www.nicepng.com/png/detail/933-9332131_profile-picture-default-png.png"
            alt="profile"
          />
        </div>
        <div className="wishlist-container">
          <h1 className="wishlist-header">Your Wishlist</h1>
          <div className="wishlist-items">
            {wish.length === 0 ? (
              <div>No items in wishlist!</div>
            ) : (
              wish.map((item) => (
                <div className="wishlist-item" key={item.id}>
                  <Link to={`/item/${item.id}`}>
                    <img src={item.image} alt={item.name} />
                  </Link>
                  <button
                    className="remove-btn"
                    onClick={() => handleRemoveWish(item)}
                  >
                    <i className="fa-solid fa-trash"></i>
                  </button>
                  <div className="food-name">{item.name}</div>
                  <div className="price">{item.price + "$"}</div>
                </div>
              ))
            )}
          </div>
        </div>
      </div>
    </>
  );
};

export default Account;
